import Navbar from './components/Navbar';
import Home from './components/Home';
import {Route} from 'react-router-dom'

function App() {
  return (
    <>
   <Navbar/>

    <Route exact path='/' Component={Home}/>
    <Route exact path='/products' Component={Products}/>
    <Home/>

   </>
  );
}

export default App;
